void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
 vec2 p =  (gl_FragCoord.xy/2. - iResolution.xy/4.)/ (iResolution.x, iResolution.y/1.2);
    float f2 = fract((p.x) /iResolution.x/ gl_FragCoord.x/gl_FragCoord.x);
       float f = cos(iTime)/(cos(p.x/f2) - gl_FragCoord.y/gl_FragCoord.x/2.)*cos(fract(p.x) * p.x/p.y*10.*cos(iTime))/1.5;
   fragColor = vec4(f,f,0.0 + f, 2.0);
}
